import {NextPage} from 'next';
import * as React from 'react';
import Link from 'next/link';
const Home: NextPage = () => {
  return (
    <>
      <div className="cover">
        <img src="/logo.png" alt=""/>
        <h1>前端爱好者博客</h1>
        <p>分享前端， H5小程序，小游戏</p>
        <p>
          <Link href="/posts">
            <a>文章列表</a>
          </Link>
        </p>
      </div>
      <style jsx>{`
        .cover {
          height: 100vh;
          display: flex;
          justify-content: center;
          align-item: center;
          flex-direction: column;
          text-align: center;
        }
        .cover > img{
          margin: 0 auto;
          width: 120px;
          height: 120px;
        }
      `}</style>
    </>
  );
};

export default Home;
